import Vue from 'vue'
import App from './App.vue'
import {
  optionalChaining,
  MakeText
} from './util/util';

Vue.prototype.$optionalChaining = optionalChaining; // 注册可选链
Vue.prototype.MakeText = MakeText; // 注册多语言翻译
Vue.config.productionTip = false

new Vue({
  render: h => h(App),
}).$mount('#app')
